public class AbnormalInfoParam {
    String userNum;
    Integer shortCount;
    Integer shortTime;
    Integer manyShortTime;
    Integer longCount;
    Integer longTime;
    Integer manyLongTime;
    Integer oneDayTime;
    Integer earlyTime;
    Integer earlyCount;

    public String getUserNum() {
        return userNum;
    }

    public void setUserNum(String userNum) {
        this.userNum = userNum;
    }

    public Integer getShortCount() {
        return shortCount;
    }

    public void setShortCount(Integer shortCount) {
        this.shortCount = shortCount;
    }

    public Integer getShortTime() {
        return shortTime;
    }

    public void setShortTime(Integer shortTime) {
        this.shortTime = shortTime;
    }

    public Integer getManyShortTime() {
        return manyShortTime;
    }

    public void setManyShortTime(Integer manyShortTime) {
        this.manyShortTime = manyShortTime;
    }

    public Integer getLongCount() {
        return longCount;
    }

    public void setLongCount(Integer longCount) {
        this.longCount = longCount;
    }

    public Integer getLongTime() {
        return longTime;
    }

    public void setLongTime(Integer longTime) {
        this.longTime = longTime;
    }

    public Integer getManyLongTime() {
        return manyLongTime;
    }

    public void setManyLongTime(Integer manyLongTime) {
        this.manyLongTime = manyLongTime;
    }

    public Integer getOneDayTime() {
        return oneDayTime;
    }

    public void setOneDayTime(Integer oneDayTime) {
        this.oneDayTime = oneDayTime;
    }

    public Integer getEarlyTime() {
        return earlyTime;
    }

    public void setEarlyTime(Integer earlyTime) {
        this.earlyTime = earlyTime;
    }

    public Integer getEarlyCount() {
        return earlyCount;
    }

    public void setEarlyCount(Integer earlyCount) {
        this.earlyCount = earlyCount;
    }
}
